Movie Information:

Release Title: Fight Club 1999 
Bluray Release Date: Nov 17, 2009 
Certification: Rated R 
Storyline: The mundane existence of a product liability evaluator and insomniac, who is addicted to self- help groups, is turned upside down when he meets a sado-masochistic anarchist who is secretly plotting to overthrow civilization. As their friendship grows, they become increasingly involved in a secret society of &quot;fight clubs&quot; where men act out their aggressions and violently beat one another to a pulp. In the meantime, the evaluator falls in love with a woman who is also addicted to self-help groups, but is unable to act on his desire for her. 
Genre: Action | Drama | Thriller 
